<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Î≤ÖÏä§ Ïù¥Ïö© Í∞ÄÏù¥Îìú</title>
    <link href="https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@400;700;900&display=swap" rel="stylesheet">
    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { font-family: 'Noto Sans KR', sans-serif; background: #fff; min-height: 100vh; display: flex; justify-content: center; align-items: center; padding: 10px; }
        .container { max-width: 1000px; width: 100%; background: white; border-radius: 15px; box-shadow: 0 15px 50px rgba(255, 60, 40, 0.3); overflow: hidden; border: 5px solid #FF3C28; }
        
        .header { 
            background: #FFFFFF; 
            color: #FF3C28; 
            padding: 15px 25px; 
            border-bottom: 3px solid #FF3C28; 
            display: flex;
            align-items: center;
            gap: 20px;
        }
        .logo { flex-shrink: 0; }
        .logo img { height: 45px; display: block; }
        .header-content { flex: 1; text-align: left; }
        .header h1 { 
            font-family: 'Noto Sans KR', sans-serif; 
            font-size: 1.8em; 
            font-weight: 900;
            margin-bottom: 5px; 
            letter-spacing: 0.5px; 
            color: #FF3C28; 
        }
        .header p { font-size: 1em; font-weight: 700; color: #FF3C28; }
        
        .progress-bar { width: 100%; height: 6px; background: #FFE5E0; }
        .progress-fill { height: 100%; background: linear-gradient(90deg, #FF3C28 0%, #FFB300 100%); transition: width 0.5s ease; }
        .slider-container { position: relative; width: 100%; overflow: hidden; background: #fff; }
        .slides { display: flex; transition: transform 0.5s ease-in-out; }
        .slide { min-width: 100%; display: flex; justify-content: center; align-items: center; padding: 20px 15px; background: #fff; }
        .slide img, .slide video { 
            max-width: 100%; 
            max-height: 750px; 
            border-radius: 12px; 
            box-shadow: 0 8px 30px rgba(78, 205, 196, 0.3); 
            border: 3px solid #4ECDC4; 
        }
        .controls { display: flex; justify-content: center; align-items: center; gap: 15px; padding: 20px; background: white; }
        
        .btn-prev { 
            background: #FF3C28; 
            color: white; 
            border: none; 
            padding: 12px 28px; 
            border-radius: 50px; 
            font-size: 1.1em; 
            font-weight: 900; 
            cursor: pointer; 
            transition: all 0.3s; 
            box-shadow: 0 4px 15px rgba(255, 60, 40, 0.3); 
            font-family: 'Noto Sans KR', sans-serif; 
        }
        .btn-prev:hover { background: #E63320; transform: translateY(-2px); }
        .btn-prev:disabled { background: #ccc; cursor: not-allowed; box-shadow: none; transform: none; }
        
        .btn-next { 
            background: #4ECDC4; 
            color: white; 
            border: none; 
            padding: 12px 28px; 
            border-radius: 50px; 
            font-size: 1.1em; 
            font-weight: 900; 
            cursor: pointer; 
            transition: all 0.3s; 
            box-shadow: 0 4px 15px rgba(78, 205, 196, 0.3); 
            font-family: 'Noto Sans KR', sans-serif; 
        }
        .btn-next:hover { background: #45B8B0; transform: translateY(-2px); }
        .btn-next:disabled { background: #ccc; cursor: not-allowed; box-shadow: none; transform: none; }
        
        .counter { font-size: 1.4em; color: #FF3C28; font-weight: 900; min-width: 100px; text-align: center; font-family: 'Noto Sans KR', sans-serif; }
        .dots { display: flex; justify-content: center; gap: 8px; padding: 15px 15px 12px 15px; background: white; border-top: 2px solid #FF3C28; flex-wrap: wrap; }
        
        .dot { 
            width: 12px; 
            height: 12px; 
            border-radius: 50%; 
            background: #FFE5E0; 
            cursor: pointer; 
            transition: all 0.3s; 
            border: 2px solid #FF3C28; 
        }
        .dot.active { 
            background: #FFB300;
            border-color: #FF3C28;
            transform: scale(1.3); 
            box-shadow: 0 0 10px rgba(255, 179, 0, 0.5); 
        }
        .dot:hover { background: #FFC947; transform: scale(1.2); }
        
        .footer {
            background: white;
            padding: 12px;
            text-align: center;
            border-top: 2px solid #FFE5E0;
            font-size: 0.85em;
            color: #999;
        }
        .footer strong { color: #4ECDC4; font-weight: 700; }
        
        @media (max-width: 768px) { 
            .header { padding: 12px 15px; gap: 12px; }
            .logo img { height: 35px; } 
            .header h1 { font-size: 1.4em; margin-bottom: 3px; } 
            .header p { font-size: 0.85em; }
            .slide { padding: 15px 10px; } 
            .slide img, .slide video { max-height: 600px; border: 2px solid #4ECDC4; } 
            .controls { padding: 15px; gap: 10px; }
            .btn-prev, .btn-next { padding: 10px 20px; font-size: 0.95em; } 
            .counter { font-size: 1.2em; min-width: 80px; }
            .dots { padding: 12px 10px 10px 10px; gap: 6px; }
            .dot { width: 10px; height: 10px; }
            .footer { padding: 10px; font-size: 0.75em; }
        }
        
        @media (max-width: 480px) { 
            body { padding: 5px; }
            .container { border: 3px solid #FF3C28; border-radius: 10px; }
            .header { padding: 10px 12px; gap: 10px; }
            .logo img { height: 30px; } 
            .header h1 { font-size: 1.2em; } 
            .header p { font-size: 0.75em; }
            .slide { padding: 10px 8px; } 
            .slide img, .slide video { border-radius: 8px; }
            .controls { padding: 12px 8px; gap: 8px; }
            .btn-prev, .btn-next { padding: 8px 16px; font-size: 0.85em; } 
            .counter { font-size: 1em; min-width: 70px; }
            .dots { padding: 10px 8px 8px 8px; gap: 5px; }
            .dot { width: 8px; height: 8px; border: 1px solid #FF3C28; }
            .footer { padding: 8px; font-size: 0.7em; }
        }
    </style>

            <button class="btn-prev" id="prevBtn" onclick="prevSlide()">‚óÄ Ïù¥Ï†Ñ</button>
            <div class="counter" id="counter">1 / 12</div>
            <button class="btn-next" id="nextBtn" onclick="nextSlide()">Îã§Ïùå ‚ñ∂</button>
        </div>
        <div class="dots" id="dots"></div>
        <div class="footer">
            Made with  by <strong>ÎØºÌò∏ÌäπÍ≥µÎåÄ</strong>
        </div>
    </div>
    <script>
        let currentSlide = 0;
        const slides = document.querySelectorAll('.slide');
        const totalSlides = slides.length;
        const slidesContainer = document.getElementById('slides');
        const counter = document.getElementById('counter');
        const dotsContainer = document.getElementById('dots');
        const prevBtn = document.getElementById('prevBtn');
        const nextBtn = document.getElementById('nextBtn');
        const progressBar = document.getElementById('progressBar');
        
        for (let i = 0; i < totalSlides; i++) {
            const dot = document.createElement('div');
            dot.className = 'dot';
            dot.onclick = () => goToSlide(i);
            dotsContainer.appendChild(dot);
        }
        const dots = document.querySelectorAll('.dot');
        
        function updateSlider() {
            slidesContainer.style.transform = `translateX(-${currentSlide * 100}%)`;
            counter.textContent = `${currentSlide + 1} / ${totalSlides}`;
            progressBar.style.width = `${((currentSlide + 1) / totalSlides) * 100}%`;
            dots.forEach((dot, index) => dot.classList.toggle('active', index === currentSlide));
            prevBtn.disabled = currentSlide === 0;
            nextBtn.disabled = currentSlide === totalSlides - 1;
            
            // ÎπÑÎîîÏò§ ÏûêÎèô ÏùºÏãúÏ†ïÏßÄ
            slides.forEach((slide, index) => {
                const video = slide.querySelector('video');
                if (video && index !== currentSlide) {
                    video.pause();
                }
            });
        }
        
        function nextSlide() { if (currentSlide < totalSlides - 1) { currentSlide++; updateSlider(); } }
        function prevSlide() { if (currentSlide > 0) { currentSlide--; updateSlider(); } }
        function goToSlide(index) { currentSlide = index; updateSlider(); }
        
        document.addEventListener('keydown', (e) => { 
            if (e.key === 'ArrowLeft') prevSlide(); 
            if (e.key === 'ArrowRight') nextSlide(); 
        });
        
        let touchStartX = 0, touchEndX = 0;
        slidesContainer.addEventListener('touchstart', (e) => { touchStartX = e.changedTouches[0].screenX; });
        slidesContainer.addEventListener('touchend', (e) => { 
            touchEndX = e.changedTouches[0].screenX; 
            if (touchEndX < touchStartX - 50) nextSlide(); 
            if (touchEndX > touchStartX + 50) prevSlide(); 
        });
        
        updateSlider();
    </script>
</body>
</html>
